// HasIdentities applies the HasEdge predicate on the "identities" edge.
func HasIdentities() predicate.ApexCustomer {
	return predicate.ApexCustomer(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, IdentitiesTable, IdentitiesColumn),
		)
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.ApexCustomerIdentity
		step.Edge.Schema = schemaConfig.ApexCustomerIdentity
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasIdentitiesWith applies the HasEdge predicate on the "identities" edge with a given conditions (other predicates).
func HasIdentitiesWith(preds ...predicate.ApexCustomerIdentity) predicate.ApexCustomer {
	return predicate.ApexCustomer(func(s *sql.Selector) {
		step := newIdentitiesStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.ApexCustomerIdentity
		step.Edge.Schema = schemaConfig.ApexCustomerIdentity
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.ApexCustomer) predicate.ApexCustomer {
	return predicate.ApexCustomer(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.ApexCustomer) predicate.ApexCustomer {
	return predicate.ApexCustomer(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.ApexCustomer) predicate.ApexCustomer {
	return predicate.ApexCustomer(sql.NotPredicates(p))
}
